import React from "react";

const Home = () => {
  return (
    <div
      className="ratio ratio-16x9 d-flex align-items-center justify-content-center mt-5"
      style={{ width: "1000px" }}
    >
      <iframe
        width="560"
        height="315"
        src="https://www.youtube.com/embed/SSo_EIwHSd4"
        title="YouTube video player"
        frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
        allowfullscreen
      ></iframe>
    </div>
  );
};

export default Home;
